This torrent collects the first 4 issues of the new ongoing series of Mr. Peabody &amp; Sherman, based on the recent film. As usual throughout their history, our dynamic duo are often caught up in crazy adventures through time. Written by Sholly Fisch with art by Jorge Molina. These low-res digital rips are by Empire; thanks to them for their hard work, and please seed and enjoy! :-)
